import styled from 'styled-components';
import React from 'react';
import Navbar from './navbar';





const Wrapper = styled.div
`   display: flex;
    flex-flow: column;
    align-items: center;
    justify-content: center;
    height: 100%;
`;

const Styleddiv = styled.div`

  display: flex;
  align-items: Left;
  flex-flow: column;
  height: 10%;
  width: 80%;
  padding: 20px;
  padding-bottom : 40px;
  margin-bottom: 8% auto;
  margin-top: 13% auto;
  border: 1px solid #fffff;
  border-radius: 9px;
  background: #f7f7f7;
  h2 {
    font-family: Arial, Helvetica, sans-serif;
    font-size: 14px;
  }
  button {
    background: #ff8019;
    color: #fff;
    padding: 11px;
    margin-top: 15px;
    width: 80%;
    border: none;
    border-radius: 4px;
    box-sizing: border-box;
  }
`;

const bariscard = styled.div
`
  content: "";
  display: table;
  clear: both;  
  margin: 0 -5px;
`;

const kolomcard = styled.div
`
width: 100%;
display: block;
margin-bottom: 20px;
float: left;
width: 25%;
padding: 0 10px;    
`;

const card = styled.div
`
box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  padding: 16px;
  text-align: center;
  background-color: blue;
`;


class Forestpage extends React.Component{

    componentDidMount()
    {
        document.body.style.backgroundColor = "#dbdbdb";
    }
    render(){
        return(
            <Wrapper>
               <Navbar/>
                <Styleddiv>
                    <h2>Forest :: Let's Collect your POKEMON!! </h2>
                    <bariscard>
                        <kolomcard>
                            <card>
                                ini kartu
                                sjsj
                            </card>
                        </kolomcard>
                        <kolomcard>
                            <card>
                                ini kartu
                            </card>
                        </kolomcard>
                    </bariscard>
                </Styleddiv>
            </Wrapper>
        );
    }
}
export default Forestpage;
